ciphertext=""
cipher_blocks=[ciphertext[i:i+32] for i in range(0, len(ciphertext), 32)]
def xor_two_strings(s1, s2):
    return bytes(a ^ b for a, b in zip(s1, s2))
png_header = bytes.fromhex('89504e470d0a1a0a0000000d49484452')
key = xor_two_strings(png_header, bytes.fromhex(cipher_blocks[0]))
img_bytes=b''.join(xor_two_strings(bytes.fromhex(block), key) for block in cipher_blocks)
with open('output.png','wb') as f:
    f.write(img_bytes)
    